import React from 'react'
import { Input, Label, GrupoInput, LeyendaError } from "../elementos/Formularios"

export default function ComponenteInput({props}) {
    return (
        <div>
            <Label htmlFor="nombre">Usuario</Label>
            <GrupoInput>
                <Input type="text" placeholder="usuario" id="nombre" />
            </GrupoInput>
            <LeyendaError>Lorem lorem lorem lorem</LeyendaError>
        </div>
    )
}
